PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE authors (
id INTEGER PRIMARY KEY AUTOINCREMENT,
name TEXT,
kana TEXT,
atuhor_type TEXT
, description TEXT);
CREATE TABLE magazines (

id TEXT PRIMARY KEY,

title TEXT,

publisher TEXT

, description TEXT);
CREATE TABLE issues (

id TEXT PRIMARY KEY,

magazine_id TEXT,

title TEXT

, cover_url text, toc_url text, description TEXT);
CREATE TABLE episodes( 
  issue_id TEXT
  , order_no INTEGER
  , title_id INTEGER
  , page_no INTEGER
  , serialization INTEGER
  , color INTEGER
  , description TEXT
);
CREATE TABLE titles( 
  -- ID(PK)
  id INTEGER PRIMARY KEY AUTOINCREMENT
  -- 作品名
  , title TEXT
  -- 種別(0:読み切り / 1:連載)
  , content_type INTEGER
  -- 掲載誌
  , publication TEXT
  -- 完結済(0:未完 / 1:完結)
  , completion INTEGER
  -- 説明
  , description TEXT
);
CREATE TABLE title_authors( 
  -- 作品ID
  title_id INTEGER
  -- 作家ID
  , author_id INTEGER
  -- 作家種別(AUTHOR / SCRIPT)
  , author_type TEXT
  -- PK
  , PRIMARY KEY (title_id, author_id)
);
CREATE TABLE contents( 
  -- 発行ID
  issue_id TEXT
  -- 掲載順
  , order_no INTEGER
  -- 作品ID
  , title_id INTEGER
  -- ページNo
  , page_no INTEGER
  -- 種別(0:読み切り / 1:連載 / 2:出張掲載)
  , content_type INTEGER
  -- カラー(0:モノクロ / 2:カラー)
  , color INTEGER
  -- 連載状態(1:新連載 / 2:連載中 / 3:最終回)
  , serialization_status INTEGER
  -- 説明
  , description TEXT
  -- PK
  , PRIMARY KEY (issue_id, order_no)
);
DELETE FROM sqlite_sequence;
COMMIT;
